import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Appointment from "./components/pages/Appointment"




const App = () => (
  <Router>
    <div>
        <Route exact path="/appointment" component={Appointment} />
    </div>
  </Router>
);

export default App;
